import { useState, useEffect, useRef } from "react";
import { Route, Routes, useLocation, useNavigate } from "react-router-dom";
import ProgressBar from "@ramonak/react-progress-bar";

export default function Main({ updateLogedIn, loginState }) {
  const navigate = useNavigate();
  useEffect(() => {
    if (loginState === false) navigate("/");
  }, []);
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        alignContent: "center",
        alignItems: "center",
        flexDirection: "column",
      }}
    >
      <div
        style={{
          marginTop: "10px",
          justifyContent: "flex-end",
          width: "100vw",
          marginRight: "10vw",
        }}
      >
        <div
          style={{
            fontSize: "30px",
            fontWeight: "bold",
            borderRadius: "10px",
            padding: "10px",
            border: "1px solid #828282",
            cursor: "pointer",
          }}
        >
          {"<"}
        </div>
        <div
          style={{
            fontSize: "30px",
            fontWeight: "bold",
            borderRadius: "10px",
            padding: "10px",
            border: "1px solid #828282",
            cursor: "pointer",
          }}
        >
          {">"}
        </div>
      </div>
      <div style={{ marginTop: "10px", maxWidth: "80vw", maxHeight: "50vh" }}>
        <img
          src="/logo512.png"
          style={{ maxWidth: "80vw", maxHeight: "50vh" }}
        />
      </div>
      <div style={{ marginTop: "10px", width: "80vw" }}>
        <ProgressBar completed={60} />
      </div>
      <div style={{ marginTop: "10px" }}>1</div>
      <div style={{ marginTop: "10px" }}>1</div>
    </div>
  );
}
